import React from "react";
import "../styles/CV.css";

function CV() {
  return (
    <div className="cv-container">
      <h1 className="cv-title">Curriculum Vitae</h1>
      <div className="cv-frame-wrapper">
        <iframe
          src={process.env.PUBLIC_URL + "/CV.pdf"}
          width="100%"
          height="900px"
          className="cv-frame"
          title="CV"
        ></iframe>
      </div>
      <div className="cv-download-wrapper">
        <a
          href={process.env.PUBLIC_URL + "/CV.pdf"}
          download="TranKhanhLinh_CV.pdf"
          className="download-btn"
        >
          <span className="download-icon">⬇️</span> Tải về CV
        </a>
      </div>
    </div>
  );
}

export default CV;
